    function animate() {
        context.clearRect(0, 0, canvas.width, canvas.height);

        if (solved) {
            context.strokeStyle = 'rgba(0,255,0)';
            context.lineWidth = 2;

            context.beginPath();
            context.arc(275, 200, 75, 0, 2 * Math.PI);
            context.stroke();
        } else {
            var now = new Date();
            var then = new Date(now.getFullYear(), now.getMonth(), now.getDate(), 0, 0, 0);
            var diff = now.getTime() - then.getTime();
            var pos = diff / 360000 - 149.23618512418798;

            if (Math.abs(Number(diff) - Number(lastBlink)) > 500) {
                lastBlink = Number(diff);
                blink = !blink;
                check_solution(String(now.getHours() + 0.0001 * now.getMinutes() + 0.0000001 * now.getSeconds()));
            }

            context.strokeStyle = 'rgba(255,255,255)';
            context.fillStyle = 'rgba(255,255,255)';
            context.lineWidth = 1;

            context.beginPath();
            for (let theta = 0; theta < 10 * Math.PI; theta = theta + 0.01) {
                r = 150 * Math.cos(theta * pos / Math.PI);
                context.lineTo(200 + (r * Math.cos(theta)), 200 + (r * Math.sin(theta)));
            }
            context.stroke();
            if (blink) {
                context.strokeStyle = 'rgba(255,0,0)';
                context.lineWidth = 2;
            } else {
                context.strokeStyle = 'rgba(200,0,0)';
                context.lineWidth = 1;
            }
        
            context.beginPath();
            context.arc(275, 200, 75, 0, 2 * Math.PI);
            context.stroke();

            window.requestAnimationFrame(animate);
        }
    }

    let canvas = document.getElementById('puzzlecanvas');
    let context = canvas.getContext('2d');
    var lastBlink = 0.0;
    var blink = false;
    var solved = false;
    animate();
</script>
